import './App.css';
import React from 'react';
import { Button, Dropdown, Space, Menu, Table, Tag } from 'antd';
import { PlusOutlined } from '@ant-design/icons';

const handleMenuClick = (e) => {
  console.log('click', e);
};

const menu = (
  <Menu
    onClick={handleMenuClick}
    items={[
      {
        label: 'new internship',
        key: '1',
        icon: <PlusOutlined />,
      }, ,
    ]}
  />
);

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
    render: (text) => <a>{text}</a>,
  },
  {
    title: 'Date',
    dataIndex: 'date',
    key: 'date',
  },
  {
    title: 'Status',
    dataIndex: 'status',
    key: 'status',
  },
  {
    title: 'Notes',
    dateIndex: 'notes',
    key: 'notes',
  }
];

const data = [];

function App() {
  return (
    <div>
      <body className="App-header">
        <Dropdown overlay={menu}>
          <Button>
            <Space>
              <PlusOutlined />
            </Space>
          </Button>
        </Dropdown>
        <Table columns={columns} data={data} />
      </body>
    </div>
  );
}

export default App;
